widgets_values:
{
  "world": {
    "name": "Vvardenfell",
    "description": "Vvardenfell is a volcanic island dominated by the looming Red Mountain, its ash-covered landscapes dotted with giant mushrooms and ancient Dwemer ruins. The ash storms and fumeroles shape the harsh terrain, while pockets of lush greenery cling to rock and cliffside.",
    "geography": {
      "continents": [
        {
          "name": "Northeast Plateau",
          "description": "A barren expanse of blackened ash and obsidian flows beneath the towering caldera of Red Mountain, home to restless ash spawn and scattered Telvanni mushroom towers."
        },
        {
          "name": "West Sea Shore",
          "description": "A coastal belt of black sand beaches and rocky coves along the Inner Sea, where fishermen harvest kwama and sailors dock at the port of Seyda Neen."
        }
      ],
      "oceans": [
        {
          "name": "Inner Sea",
          "description": "A brackish inlet separating Vvardenfell from the mainland of Morrowind, its waters teeming with algal blooms and washed-over wrecks of ancient craglorn vessels."
        }
      ],
      "landmarks": [
        {
          "name": "Red Mountain",
          "type": "Volcano",
          "location": "Lat: 45.233, Lon: -42.117",
          "description": "A colossal, perpetually smoking volcano at the islands center. Its slopes are riddled with Dwemer ruins, Telvanni strongholds, and the heart of the ash wastes."
        },
        {
          "name": "Balmora Hlaalu Estate",
          "type": "City",
          "location": "Lat: 45.600, Lon: -44.300",
          "description": "A bustling port town under House Hlaalus dominion, its canals and stone bridges linking market stalls, guild halls, and the grand council manor."
        }
      ]
    },
    "nations": [
      {
        "name": "Great House Hlaalu",
        "capital": "Balmora",
        "government": "Feudal House",
        "description": "A politically savvy House that prizes trade and commerce, ruling the western settlements with an eye toward profit and alliances with outsiders."
      },
      {
        "name": "Great House Redoran",
        "capital": "Ald'ruhn",
        "government": "Feudal House",
        "description": "A militaristic House devoted to honor and defense, based beneath the mushroom towers of Ald'ruhn and sworn to protect Dunmer traditions."
      }
    ]
  },
  "cultures": [
    {
      "name": "Dunmer",
      "customs": "Dunmer honor their ancestors through nightly ash-veil vigils, leaving offerings of saltrice cakes and chanting ancient invocations to ward off daedric influence.",
      "language": "Dunmeri",
      "religion": {
        "name": "Tribunal Temple",
        "pantheon": [
          {
            "deity": "Vivec, Warrior-Poet",
            "domains": ["War", "Mercy"]
          },
          {
            "deity": "Almalexia, Lady of Mercy",
            "domains": ["Healing", "Protection"]
          }
        ]
      }
    },
    {
      "name": "Ashlander",
      "customs": "Ashlanders roam the ash wastes in tribes, conducting rites at fumeroles and weaving animal hides into sigils to protect against Corprus and ash storms.",
      "language": "Dunmeri",
      "religion": {
        "name": "The Ashlander Spirits",
        "pantheon": [
          {
            "deity": "Naagran Dagon, Lord of Change",
            "domains": ["Daedra", "Chaos"]
          },
          {
            "deity": "Sheogorath, Mad God",
            "domains": ["Madness", "Trickery"]
          }
        ]
      }
    }
  ],
  "history": {
    "ancient_events": [
      {
        "year": 700,
        "title": "Battle of Red Mountain",
        "summary": "The climactic conflict that shattered the Dwemer civilization and forged the Tribunal. Dagoth Urs betrayal led to Dwemer disappearance and the rise of Vivec as a living god."
      },
      {
        "year": 702,
        "title": "Ascension of the Tribunal",
        "summary": "Vivec, Almalexia, and Sotha Sil completed the Heart of Lorkhan, ascending to godhood and establishing the Tribunal Temple as the unifying faith of the Dunmer."
      }
    ]
  },
  "magic_system": {
    "types": [
      {
        "name": "Soul Gem Enchanting",
        "description": "Artisans trap creature souls in crystal gems and use them to imbuing weapons and armor with magical effects, from fire damage to mending wounds."
      },
      {
        "name": "Temple Writs",
        "description": "Priests of the Tribunal invoke Almsivi blessings through sacred writs and songs, channeling divine magicka to heal, shield, or reveal hidden truths."
      }
    ]
  },
  "fauna_flora": {
    "fauna": [
      {
        "name": "Netch",
        "type": "Leviathan",
        "habitat": "West Sea Shore",
        "description": "Gentle, floating leviathans whose pulsating membranes glow at dusk. Mounted by nobles, these creatures drift over the ash dunes."
      },
      {
        "name": "Guar",
        "type": "Beast",
        "habitat": "Ashlands",
        "description": "Sturdy two-legged beasts used as pack animals by the Ashlanders. Their thick hides and broad hooves navigate the ash-choked terrain with ease."
      }
    ],
    "flora": [
      {
        "name": "Nirnroot",
        "type": "Plant",
        "region": "East Gash",
        "description": "A luminescent waterweed with distinct chiming tones. Alchemists prize its leaves and stalks for powerful potions and poisons."
      },
      {
        "name": "Corprus Fungus",
        "type": "Fungus",
        "region": "Ashlands Caves",
        "description": "A grotesque fungal growth that induces Corprus disease in those who inhale its spores. Used cautiously in certain Daedric rituals."
      }
    ]
  }
}
